import userEvent from '@testing-library/user-event'
import React, { ReactElement } from 'react'

interface Props {
    
}

export default function Auth({}: Props): ReactElement {
    return (
        <div>
            <div className = "input-label-block">
                <span>Email:</span> <input type = "text" onChange = {e => {userEvent.name = e.target.value}}/>
                <span>Password:</span><input type = "text"/>
            </div>
            <div className = 'btn-auth-block'>
                <button className = 'btn'>Cancel</button>
                <button className = 'btn'>Submit</button>
            </div>
        </div>
    )
}
